import React from "react";

const acheivements = [
  {
    id: 1,
    title: "Achievement 1",
    description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  },
  {
    id: 2,
    title: "Achievement 2",
    description:
      "Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.",
  },
  {
    id: 3,
    title: "Achievement 3",
    description:
      "Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi.",
  },
];

const strengths = [
  {
    id: 1,
    title: "Strength 1",
    description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  },
  {
    id: 2,
    title: "Strength 2",
    description:
      "Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.",
  },
  {
    id: 3,
    title: "Strength 3",
    description:
      "Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi.",
  },
];

export const More = () => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
      <div>
        <h2 className="text-2xl font-bold mb-4">Achievements</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          {acheivements.map((achievement) => (
            <div key={achievement.id} className="bg-gray-100 p-4 rounded-md">
              <h3 className="text-lg font-semibold mb-2">
                {achievement.title}
              </h3>
              <p>{achievement.description}</p>
            </div>
          ))}
        </div>
      </div>
      <div>
        <h2 className="text-2xl font-bold mb-4">Strengths</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          {strengths.map((strength) => (
            <div key={strength.id} className="bg-gray-100 p-4 rounded-md">
              <h3 className="text-lg font-semibold mb-2">{strength.title}</h3>
              <p>{strength.description}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};
